window.bookSummaryJSON = "<p>Hail Bristol: former runaway princess, interplanetary gunrunner, Empress of Indrana.</p> <p>When the Empire's closest ally asks her to intervene in a galactic military crisis, she embarks on the highest stakes diplomatic mission Indrana has ever faced.</p> <p>Caught between two powerful alien civilizations at each other's throats, Hail has one chance to make peace before all of humanity becomes collateral damage in a full-blown galactic war.</p> <p><i>There Before the Chaos</i> begins a fresh pulse-pounding space opera series from an exciting new voice in science fiction.</p>"; 
